import React from 'react';
import { View,Text, TextInput, Button,StyleSheet,Image } from 'react-native';
import Footer from "../shared/Footer";

  

function SignIn(props) {
    return (
        <div>
          <View style={styles.container}>
                <Text> <h3>Signup</h3> </Text>
                <View><Image style={styles.Img} source={{url:'../../assets/images:/logo.jpg'}} /></View>
                
               <form>
                <View>
                    <Text id="Email" name="Email"><h3>Email</h3></Text>
                    <TextInput style={styles.Imput} for="#Email" type="email" placeholder="Please enter your Email here!!"/>
                </View>
                <br/>
                <View>
                    <Text id="Email" name="Email"><h3>Password</h3></Text>
                    <TextInput for="Password" secureTextEntry={true} placeholder="Please enter Passowrd"/>
                </View>
                <br/>
                <Button type="submit" title="SIGN IN"> </Button>

                </form>
                <br/>
                <Footer/> 
            </View>
           
            
            
        </div>
    );
}

export default SignIn;

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: '',
      justifyContent: '',
    },
    Img:{
        height:'40px',
        width:'40px',
      
    },
    imput:{
        border:" solid black",
        borderRadius:"15px",
        height:"35px"

    } 
  });
